import React from 'react'
import { AppBar, Toolbar } from "@mui/material";
const Header = () => {
    const appHeader = () => {
        return <Toolbar>Header goes here</Toolbar>;
    };
    return (
        <header>
            <AppBar>{appHeader}</AppBar>
        </header>

    );
}

export default Header
